////////////////////
bool neroshop::Icon::export_png(unsigned char * data, unsigned int width, unsigned int height, const std::string& name) {
    // Check if resources/ or assets/ directory exists. If not then create it
    if(!std::filesystem::is_directory(NEROSHOP_RESOURCES_FOLDER)) {
        // Create the resources/ or assets/ path
        if(!std::filesystem::create_directories(NEROSHOP_RESOURCES_FOLDER)) {
            neroshop::print("Failed to create resources path", 1);
            return false;
        }
        neroshop::print("PATH \"" + std::string(NEROSHOP_RESOURCES_FOLDER) + "/\" created", 3);
    }
    
    // First check if file exists or not. If not then create it
    std::string filename = std::string(NEROSHOP_RESOURCES_FOLDER) + "/" + name + ".png";
    if(!std::filesystem::is_regular_file(filename)) {
        // Export in-memory image to png file (as a fallback)
        if(!write_png(data, width, height, filename)) {
            neroshop::print("Failed to export to " + filename, 1);
            return false;
        }
        neroshop::print("IN-MEMORY ICON \"" + name + "\" exported to " + filename, 3);
    }
    
    return true;
}
////////////////////
bool neroshop::Icon::write_png(unsigned char * data, unsigned int width, unsigned int height, const std::string& filename) {
	FILE *file_ptr = NULL;
	png_structp png_ptr = NULL;
	png_infop info_ptr = NULL;
	png_bytep * row = nullptr;
	
	// Open file for writing (binary mode)
	file_ptr = fopen(filename.c_str(), "wb");
	if (file_ptr == NULL) {
		neroshop::print("Could not open file " + filename + " for writing", 1);
		return false;
	}

	// Initialize write structure
	png_ptr = png_create_write_struct(PNG_LIBPNG_VER_STRING, NULL, NULL, NULL);
	if (png_ptr == NULL) {
		neroshop::print("Could not allocate write struct", 1);
		fclose(file_ptr);
        return false;
	}
	
	// Initialize info structure
	info_ptr = png_create_info_struct(png_ptr);
	if (info_ptr == NULL) {
		neroshop::print("Could not allocate info struct", 1);
		fclose(file_ptr);
	    png_free_data(png_ptr, info_ptr, PNG_FREE_ALL, -1);
        return false;
	}
	
	// Setup Exception handling
	if (setjmp(png_jmpbuf(png_ptr))) {
		neroshop::print("Error during png creation", 1);
		fclose(file_ptr);
	    png_free_data(png_ptr, info_ptr, PNG_FREE_ALL, -1);
	    png_destroy_write_struct(&png_ptr, (png_infopp)NULL);
        return false;
	}

	// Start write
	png_init_io(png_ptr, file_ptr);
    // Write header - store color, depth, etc.
	int bit_depth  = 8;
	int color_type = 6;
    png_set_IHDR(png_ptr, info_ptr, width, height,
        bit_depth, color_type, PNG_INTERLACE_NONE,
        PNG_COMPRESSION_TYPE_BASE, PNG_FILTER_TYPE_BASE);
	// Write all image info
	png_write_info(png_ptr, info_ptr);

	// Row size in bytes.
    int row_bytes = png_get_rowbytes(png_ptr, info_ptr);
	// Allocate memory for row
	row = new png_bytep[height];
	if (!row) {
        png_destroy_write_struct(&png_ptr, &info_ptr);
        fclose(file_ptr);
	    return false;
    }
    
    // Write image data
	for(int i=0; i < height; ++i) {
		row[height - 1 - i] = (png_byte*)data + i * row_bytes;
	}
	png_write_image(png_ptr, (png_bytepp)row);

    // End write
	png_write_end(png_ptr, nullptr);
	
	if (file_ptr != NULL) fclose(file_ptr);
	if (info_ptr != NULL) png_free_data(png_ptr, info_ptr, PNG_FREE_ALL, -1);
	if (png_ptr != NULL) png_destroy_write_struct(&png_ptr, (png_infopp)NULL);
	if (row != nullptr) { 
	    delete [] row;
	    row = nullptr;
	}
	
	return true;
}	
